  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108093 includes chemical,
  meteorological, physical and underway - surface data collected from NOAA Ship RONALD
  H. BROWN in the Gulf of Guinea, Gulf of Mexico, North Atlantic Ocean and South Atlantic
  Ocean from 2010-03-08 to 2010-12-20 and retrieved during cruise RB-10-01, RB-10-02,
  RB-10-07, RB-10-08 and RB-10-09. These data include BAROMETRIC PRESSURE, CARBON
  DIOXIDE - AIR, CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, Partial pressure
  (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE. The instruments
  used to collect these data include Carbon dioxide (CO2) gas analyzer and Shower
  head chamber equilibrator for autonomous carbon dioxide (CO2) measurement. These
  data were collected by Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic
  and Meteorological Laboratory as part of the R/V Ronald Brown 2010 Underway Data
  data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
  UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
  from 14 countries have been outfitting research ships and commercial vessels with
  automated CO2 sampling equipment to analyze the carbon exchange between the ocean
  and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
